import React from 'react';
import { useHistory } from 'react-router-dom';

function Test(props) {
    const history = useHistory();
    const handleHistory = () =>{
        history.push('/Home')
    }
    return (
        <div>
            <button onClick={handleHistory}>
                click to go Home
            </button>
        </div>
    );
}

export default Test;
